<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Unordered List</title>
</head>
<body>
    <h1>Unordered Lists</h1>
    <ul>
        <li>HTML5</li>
        <li>CSS3</li>
        <li>JQUERY</li>
        <li>BOOTSTRAP</li>
        <li>NODEJS</li>
        <li>REACT</li>
    </ul>
    <ul type="square">
        <li>HTML5</li>
        <li>CSS3</li>
        <li>JQUERY</li>
        <li>BOOTSTRAP</li>
        <li>NODEJS</li>
        <li>REACT</li>
    </ul>

    <ul>
        <li>HTML5</li>
        <li>CSS3</li>
        <ul>
            <li>JQUERY</li>
            <li>BOOSTRAP</li>
        </ul> 
        <li>NODEJS</li>
        <li>REACT</li>
        <ul>
            <li>VUE</li>
            <li>ANGULAR</li>
        </ul>
    </ul>
</body>
</html>
